import React from "react";
import {
  AppBar,
  Toolbar,
  makeStyles,
  Button,
  Link,
  Typography,
} from "@material-ui/core";
import HeaderLabel from "./HeaderLabel";
import SpaceElement from "../SpaceElement/SpaceElement";
import axios from "axios";

const testURL = "http://localhost:8080/api/homepage";
const baseURL = "http://localhost:8080/api";
const clientID = "2772597d9ced75b5d8fc0e0a569e27c2";
const CC_URL = "https://api.codechef.com/oauth/authorize";
const REDIRECT_URI = "http://localhost:8080/api/login/keydetails";

const fullURL =
  "https://api.codechef.com/oauth/authorize?response_type=code&client_id=2772597d9ced75b5d8fc0e0a569e27c2&redirect_uri=http%3A%2F%2Flocalhost%3A8080%2Fapi%2Flogin%2Fkeydetails&state=xyz";

const backEndURLLOGIN = "http://localhost:8080/api/login";

const useStyles = makeStyles((theme) => ({
  root: {
    flexGrow: 1,
  },
  element: {
    margin: theme.spacing(2),
  },
}));

function Header() {
  const classes = useStyles();
  return (
    <AppBar position="static" className={classes.root}>
      <Toolbar>
        <Typography>Codechef</Typography>
        <Typography>
          <Link color="inherit" href={backEndURLLOGIN}>
            Login
          </Link>
        </Typography>
        <SpaceElement />
        <Typography>
          <Link color="inherit" href={backEndURLLOGIN}>
            Login
          </Link>
        </Typography>
      </Toolbar>
    </AppBar>
  );
}

export default Header;
